import React, { useState, useEffect } from 'react';
import Modal from './Modal';

function CampaignForm({ isOpen, onClose, onSave, initialData }) {
  const [campaignData, setCampaignData] = useState({});

  useEffect(() => {
    if (initialData) {
      // Chế độ Edit: nạp dữ liệu có sẵn
      setCampaignData(initialData);
    } else {
      // Chế độ Create: reset form
      setCampaignData({
        name: '',
        description: '',
        start_date: '',
        end_date: '',
        status: 'draft', // default
      });
    }
  }, [initialData, isOpen]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCampaignData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(campaignData);
  };

  return (
    <Modal isOpen={isOpen} onClose={onClose}>
      <form onSubmit={handleSubmit}>
        <h2>{initialData ? 'Edit Campaign' : 'Add New Campaign'}</h2>

        <div style={{ marginBottom: '10px' }}>
          <label>Campaign Name:</label>
          <br />
          <input
            type="text"
            name="name"
            value={campaignData.name || ''}
            onChange={handleChange}
            required
            style={{ width: '95%' }}
          />
        </div>

        <div>
          <label>Description:</label>
          <br />
          <textarea
            name="description"
            value={campaignData.description || ''}
            onChange={handleChange}
            rows={3}
            style={{ width: '95%' }}
          />
        </div>

        <div>
          <label>Start Date:</label>
          <br />
          <input
            type="date"
            name="start_date"
            value={campaignData.start_date?.split('T')[0] || ''}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>End Date:</label>
          <br />
          <input
            type="date"
            name="end_date"
            value={campaignData.end_date?.split('T')[0] || ''}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Status:</label>
          <br />
          <select
            name="status"
            value={campaignData.status || 'draft'}
            onChange={handleChange}
            style={{ width: '100%' }}
          >
            <option value="draft">Draft</option>
            <option value="active">Active</option>
            <option value="ended">Ended</option>
          </select>
        </div>

        <div className="form-button">
          <button type="submit" style={{ marginRight: '10px' }}>
            Save
          </button>
          <button
            type="button"
            onClick={onClose}
            style={{ backgroundColor: '#f44336' }}
          >
            Cancel
          </button>
        </div>
      </form>
    </Modal>
  );
}

export default CampaignForm;
